from deepface import DeepFace
from retinaface import RetinaFace
import base64

img1 = """data:image/jpeg;base64,"""

img2 = """data:image/jpeg;base64,"""


def getFileExtension():
    ext = ''
    first_split = img1.split(',')
    if (len(first_split) == 2):
        second_split = first_split[0].split('/')
        if (len(second_split) == 2):
            third_split = second_split[1].split(';')
            if (len(third_split) == 2):
                ext = third_split[0]
    return ext


ext = getFileExtension()


def compareHumans():
    if (len(ext) > 0):
        newImg1 = img1.split(',')[1]
        base64Byte = newImg1.encode('utf-8')
        with open('image.{}'.format(ext), 'wb') as imageFile:
            decoded_data = base64.decodebytes(base64Byte)
            imageFile.write(decoded_data)
        face = RetinaFace.detect_faces(img_path='./image.{}'.format(ext))
        if (len(face) == 1):
            result = DeepFace.verify(
                img1_path=img1, img2_path=img2, model_name='Facenet', distance_metric='euclidean')
            print(result, face)
        else:
            print('Please use images with only one person')
    else:
        print('Photo is missing')


compareHumans()
